import React, {Component} from 'react';
//import PropTypes from 'prop-types';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';



class Iconsss extends Component {
  render() {
    return (
      <div>
        <div class="share-lists">
  <a href="#!" class="share-list">
    <i class="share-icon fab fa-twitter"></i>
  </a>
  <a href="#!" class="share-list">
    <i class="share-icon fab fa-facebook-f"></i>
  </a>
</div>
      </div>

    )
  }
}

export default Iconsss;
